import React from 'react';
import { useParams } from 'react-router-dom';

import useCountry from '../../custom-hooks/useCountry';

function SingleCountry(props) {
    const { name } = useParams();
    const
        {
            capital,
            altSpellings,
            region,
            subregion,
            area,
            borders,
            currencies,
            languages
        }
            = useCountry(name);

    return (
        <div>
            <h1>{name}</h1>
        </div>
    )
}

export default SingleCountry;
